The best event of all time, in one of the best places in the world. I can’t say enough thanks to the whole Frew family @danfrew @brettfrew @krisfrew75 for the massive efforts in making this event happen for the whole two wheel action sports community. Events like this don’t come around often and I think I can speak for most of everyone there by saying they wouldn’t miss it for the world! Despite the wind, the event was still one for the books! Also can’t thank @gypsytalespodcast and @jaydenfabry for the non stop grind the whole trip! Hope y’all enjoyed following along! 🙌🏼✌🏼🇳🇿
